describe("timeSpan",function(){it("from 1000 ms = 1000 ms",function(){return expect(TimeSpan.from(0,0,0,0,1e3).valueOf()).toBe(1e3)}),it("from 1 sec = 1000 ms",function(){return expect(TimeSpan.from(0,0,0,1).valueOf()).toBe(1e3)}),it("from 1 minute = 60 * 1000 ms",function(){return expect(TimeSpan.from(0,0,1).valueOf()).toBe(6e4)}),it("from 1 hour = 60 * 60 * 1000 ms",function(){return expect(TimeSpan.from(0,1).valueOf()).toBe(36e5)}),it("from 1 day = 24 * 60 * 60 * 1000 ms",function(){return expect(TimeSpan.from(1).valueOf()).toBe(864e5)}),it("from 1 minute add 2 minute = 3 * 60 * 1000 ms",function(){return expect(TimeSpan.from(0,0,1).add(0,0,2).valueOf()).toBe(18e4)})})